import Vue from "vue";
import App from "./App.vue";
import router from '@/router';
import vuetify from "./plugins/vuetify";

Vue.config.productionTip = false;

new Vue({
  vuetify,
  router,
  render: (h) => h(App),
}).$mount("#app")
.$use(router);


const app = createApp(App);
app.directive('focus', focus);
app.use(globalDirectives);
app.use(dayjs);
app.use(router);
app.use(createPinia());
app.mount('#app');
